import React, {Component} from 'react';
import './App.css';
import Header from './components/Header';
import Nav from './components/Nav';
import Article from './components/Article';

class App extends Component {
  render(){
    return (
      <div className="App">
        <Header title="react-app!" body="react practicing and discovering"></Header>
        <Nav></Nav>
        <Article title="artcle title" body="article body are landing here"></Article>
      </div>
    );
  }
}

export default App;
